      "<div>\n<div><strong>Mayor Kowalik Announces Bus Driver Appreciation Day</strong></div>\n<div>FRECOSTA (April 2)—Mayor Ed Kowalik has declared April 21 the city’s first ever Bus Driver Appreciation Day. Bus riders are asked to greet drivers with a warm hello and one of the city’s specially designed thankyou cards, which can be printed out from www.frecosta.gov/transitappreciation. As an added gesture of gratitude, Mayor Kowalik will invite bus drivers to attend a sporting event free of charge next month.</div>\n<div>Because the city’s population has increased over the past two years, Frecosta’s bus drivers have had to cope with frequent changes to bus routes. However, next year’s long-anticipated opening of the Frecosta subway line is expected to alleviate some of the stress on drivers while creating more jobs. The subway line will connect the Bargain Town Shopping Center on the western end of the city with Frecosta Stadium, which is located on the eastern end.</div>\n<hr>\n<div>YOU’RE INVITED!</div>\nWho: Frecosta Public Transit Services\xa0Employees<br>\nWhat: Frecosta Kickers Football Game<br>\nWhere: Frecosta Stadium<br>\nWhen: May 7 at 2:00 p.m.<br>\nIn honor of your hard work for the city, we\xa0are pleased to offer FREE tickets to the\xa0Frecosta Kickers football game on May 7.\n<p>To download your e-tickets, visit\xa0www.frecostakickers.com/tickets and enter\xa0the discount code “FPTS OFFER” at\xa0checkout. This code will allow you to access\xa0one free ticket. You may also purchase up\xa0to five guest tickets for family and friends at\xa0$7 each.<br>\nPlease join us in the stadium clubhouse at\xa01:00 p.m. for a light snack before the game.\xa0<br>\n(Note: For transit employees and their\xa0guests only.)<br>\n\xa0</br></br></br></p>\n</br></br></br></br></hr></div>",
