    detail:
      '<div><div><b>Mission Statement</b></div><span class="fontstyle2">The Hulani Harbor Neighborhood Association (HHNA) is a self-governing organization that strives to promote a safe, vibrant, and enjoyable community for all. Members live in the Hulani Harbor area and are committed to the following goals:<br/>1. Ensuring that the Hulani Harbor area maintains a range of housing types and<br/>price levels<br/>2. Preserving the architectural character of historic homes<br/>3. Planning seasonal gatherings and events for residents<br/>4. Promoting open discussion of local issues and initiatives</span><br/> <hr/><p>*NOTICE*</p><p><b>The Hulani Harbor Neighborhood Association Quarterly Meeting</b></p><p>Scheduled for Thursday, April 20, at 7:00 p.m.</p><p><u>New topics added to the meeting agenda:</u></p><p>• The Chenaux Company seeks rezoning for 3912 Bennett Avenue, a residential structure built in 1909. The company is requesting that the property be approved for commercial use, after which the house would be completely remodeled. We invite residents to attend the city council meeting on Monday, April 17, to learn more about the company’s request and then be prepared to discuss further at the HHNA meeting on Thursday evening.</p><p>• The leadership committee for the Brazoria Creek sector announces a position opening. Duties include serving as point of contact for residents, distributing the monthly newsletter, and sharing information with other leaders of the HHNA. Individuals who are interested in representing Brazoria Creek will each be asked to speak briefly before a vote will take place.</p><hr/><p>*ANNOUNCEMENT*</p><p>The HHNA is pleased to announce that Elena Redman has been selected as the next representative to the HHNA for the Brazoria Creek sector. Ms. Redman has held various roles in local public interest organizations. She stated, “Although I am retired  professionally, the focus of my career has been supporting people and communities through advocacy and education. I look forward to helping the community where I have been living for over 25 years."<br/></p><hr/></div>',
    transcript:
      '<div><div><b>Tuyên bố sứ mệnh</b></div><span class="fontstyle0">196</span><span class="fontstyle0">Hiệp hội Khu phố Cảng Hulani (HHNA) là một tổ chức tự quản </span><span class="fontstyle2">luôn cố gắng thúc đẩy một cộng đồng an toàn, sôi động và thú vị </span><span class="fontstyle0">196</span><span class="fontstyle0">cho tất cả mọi người</span><span class="fontstyle2">. Các thành viên sống trong khu vực Cảng Hulani và cam kết thực hiện các mục tiêu sau:<br/>1. Đảm bảo rằng khu vực Cảng Hulani duy trì nhiều loại nhà ở và mức giá <br/></span><span class="fontstyle0">(198)</span><span class="fontstyle0">2. Bảo tồn đặc điểm kiến trúc của các ngôi nhà lịch sử<br/></span><span class="fontstyle2">3. Lên kế hoạch cho các cuộc tụ họp và sự kiện theo mùa cho cư dân<br/>4. Thúc đẩy thảo luận cởi mở về các vấn đề địa phương và các sáng kiến</span><br/><hr/><div>*NOTICE*</div><div><b>Cuộc họp hàng quý của Hiệp hội Khu phố Cảng Hulani</b></div><div>Dự kiến vào Thứ Năm, ngày 20 tháng 4, lúc 7:00 tối</div><div><u>Các chủ đề mới được thêm vào chương trình họp:</u></div><div>•198Công ty Chenaux tìm kiếm quy hoạch lại cho 3912 Bennett Avenue, một công trình kiến trúc dân cư được xây dựng vào năm 1909. Công ty đang yêu  cầu ngôi nhà được chấp thuận cho mục đích sử dụng thương mại, sau đó ngôi nhà sẽ được tu sửa lại hoàn toàn. 197Chúng tôi mời cư dân tham dự cuộc họp hội đồng thành phố vào thứ Hai, ngày 17 tháng 4, để tìm hiểu thêm về yêu cầu của công ty và sau đó sẵn sàng thảo luận thêm tại cuộc họp HHNA vào tối thứ Năm.</div><div>•Ủy ban lãnh đạo của khu vực Brazoria Creek thông báo về vị trí đang tuyển. Các nhiệm vụ bao gồm đóng vai trò là đầu mối liên lạc cho cư dân, phân phát bản tin hàng tháng và chia sẻ thông tin với các nhà lãnh đạo khác của HHNA. 199Mỗi cá nhân quan tâm đến việc đại diện cho Brazoria Creek sẽ được yêu cầu phát biểu ngắn gọn trước khi cuộc bỏ phiếu diễn ra.</div><hr/><p>*ANNOUNCEMENT*<br/></p><p>199HHNA vui mừng thông báo rằng Elena Redman đã được chọn làm đại diện tiếp theo cho HHNA cho khu vực Brazoria Creek. 200Bà Redman đã giữ nhiều vai trò khác nhau trong các tổ chức công ích địa phương. Cô nói, “Mặc dù tôi đã nghỉ hưu, trọng tâm trong sự nghiệp của tôi là hỗ trợ mọi người và cộng đồng thông qua vận động và giáo dục. Tôi mong muốn được giúp đỡ cộng đồng nơi tôi đã sinh sống hơn 25 năm ”.<br/></p><hr/></div>',
